import React from 'react';

function App() {
  return (
    <div style={{ textAlign: 'center', marginTop: '10%' }}>
      <h1>Welcome to VAPTlab</h1>
      <a href="http://localhost:5001/auth/github">
        <button style={{ fontSize: '20px', padding: '10px 20px' }}>Sign in with GitHub</button>
      </a>
    </div>
  );
}

export default App;
